css:
.project-manager input {
  width: 100%;
}
.project-manager [data-path-missing="true"] .primary-line,
.project-manager [data-path-missing="true"] .secondary-line {
  opacity: 0.4;
}
.project-manager [data-path-missing="true"] .secondary-line .icon:before {
  color: #e2c08d;
}
.project-manager-list-group {
  color: rgba(153, 168, 184, 0.6);
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: #323d48;
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #99a8b8;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #ff6347;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
